                    <NavLink
                        to="/"
                        activeStyle={{
                            fontWeight: "bold",
                            color: "#683FDB"
                        }}
                    >
                        Team
                    </NavLink>
                    <NavLink
                        to="/"
                        activeStyle={{
                            fontWeight: "bold",
                            color: "#683FDB"
                        }}
                    >
                        Contact
                    </NavLink>
                    <div className='nav-dl-btn-container'>
                        <button className="nav-dl-btn" href="#">Download App</button>
                    </div>
                </nav>
            </div>
        )
    }
}
